import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';

// Dummy Components for Routes
const DietInsufficient = () => <div>Diet Plan for Insufficient Weight</div>;
const DietNormal = () => <div>Diet Plan for Normal Weight</div>;
const DietOverweight1 = () => <div>Diet Plan for Overweight Level 1</div>;
const DietOverweight2 = () => <div>Diet Plan for Overweight Level 2</div>;
const DietObesity1 = () => <div>Diet Plan for Obesity Level 1</div>;
const DietObesity2 = () => <div>Diet Plan for Obesity Level 2</div>;
const DietObesity3 = () => <div>Diet Plan for Obesity Level 3</div>;

function App() {
  const [formData, setFormData] = useState({
    gender: '',
    age: '',
    height: '',
    weight: '',
    family_history_with_overweight: '',
    FAVC: '',
    FCVC: '',
    NCP: '',
    CAEC: '',
    SMOKE: '',
    CH2O: '',
    FAF: '',
    TUE: '',
    CALC: '',
    MTRANS: '',
  });

  const [prediction, setPrediction] = useState(null);
  const [predictionUrl, setPredictionUrl] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }

      const result = await response.json();
      const predictionValue = result.prediction;
      const predictionText = getPredictionText(predictionValue);
      const predictionUrl = `/diet-${predictionValue}`;

      setPrediction({ text: predictionText });
      setPredictionUrl(predictionUrl);
    } catch (error) {
      console.error('Error during fetch:', error);
    }
  };

  const getPredictionText = (value) => {
    switch (value) {
      case 0: return 'Insufficient weight';
      case 1: return 'Normal weight';
      case 2: return 'Overweight Level 1';
      case 3: return 'Overweight Level 2';
      case 4: return 'Obesity Level 1';
      case 5: return 'Obesity Level 2';
      case 6: return 'Obesity Level 3';
      default: return 'Unknown';
    }
  };

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Obesity Risk Prediction</h1>
        </header>
        <form onSubmit={handleSubmit}>
          {/* Simplified Form Fields */}
          <div>
            <label>Gender:</label>
            <select name="gender" value={formData.gender} onChange={handleChange} required>
              <option value="">Select</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="other">Other</option>
            </select>
          </div>
          {/* Add other form fields similarly... */}
          <button type="submit">Get Prediction</button>
        </form>
        {prediction && (
          <div className="prediction-container">
            <p>Prediction: {prediction.text}</p>
            {predictionUrl && (
              <Link to={predictionUrl} target="_blank">
                View Dietary Recommendations
              </Link>
            )}
          </div>
        )}
        <footer className="App-footer">
          {/* Replace with actual facts if needed */}
          <p>Some interesting health fact...</p>
        </footer>
      </div>

      {/* Define Routes */}
      <Routes>
        <Route path="/diet-0" element={<DietInsufficient />} />
        <Route path="/diet-1" element={<DietNormal />} />
        <Route path="/diet-2" element={<DietOverweight1 />} />
        <Route path="/diet-3" element={<DietOverweight2 />} />
        <Route path="/diet-4" element={<DietObesity1 />} />
        <Route path="/diet-5" element={<DietObesity2 />} />
        <Route path="/diet-6" element={<DietObesity3 />} />
      </Routes>
    </Router>
  );
}

export default App;
